import { asyncTopic, asyncSub } from "../../../store/store";
import side from "react";

export default function Sidemenu() {
  const dispatch = useDispatch();

  const topic_list = useSelector((state) => state.topicSlice.list);
  useEffect(() => {
    dispatch(asyncTopic());
  }, []);

